function MovieCard({ title, year, posterUrl, shortPlot, rating }) {
  return (
    <div style={{ border: "1px solid #ccc", borderRadius: "8px", padding: "10px", margin: "10px", width: "200px" }}>
      <img
        src={posterUrl}
        alt={title}
        style={{ width: "100%", borderRadius: "8px" }}
      />
      <h3>{title} ({year})</h3>
      <p>{shortPlot}</p>
      <p><strong>Rating:</strong> {rating}</p>
    </div>
  );
}

export default MovieCard;
